Below is a Solidity smart contract that meets the specified requirements. This contract utilizes the `mapping` data structure to store messages, where each message is associated with its sender's address. The `messageCount` mapping keeps track of the number of times each message has been updated.

```solidity
pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping to store messages
    mapping(address => mapping(uint256 => string)) public messages;
    // Mapping to count the number of updates for each message
    mapping(address => mapping(uint256 => uint256)) public messageCount;

    // Event to notify when a message is updated
    event MessageUpdated(address indexed sender, uint256 indexed messageIndex);

    // Function to save a message
    function saveMessage(string memory _message) public {
        // Get the current message count for the sender
        uint256 messageIndex = messageCount[msg.sender].length;
        // Update the message count
        messageCount[msg.sender][messageIndex] = messageIndex;
        // Save the message
        messages[msg.sender][messageIndex] = _message;
        // Emit an event to notify the message update
        emit MessageUpdated(msg.sender, messageIndex);
    }

    // Function to update a message
    function updateMessage(uint256 _messageIndex, string memory _newMessage) public {
        // Check if the sender is the owner of the message
        require(msg.sender == address(messages[msg.sender][_messageIndex]), "Only the owner can update the message");
        // Update the message
        messages[msg.sender][_messageIndex] = _newMessage;
        // Increment the message count
        messageCount[msg.sender][_messageIndex]++;
        // Emit an event to notify the message update
        emit MessageUpdated(msg.sender, _messageIndex);
    }

    // Function to get a message
    function getMessage(address _sender, uint256 _messageIndex) public view returns (string memory) {
        // Return the message
        return messages[_sender][_messageIndex];
    }

    // Function to get the count of updates for a message
    function getMessageCount(address _sender, uint256 _messageIndex) public view returns (uint256) {
        // Return the message count
        return messageCount[_sender][_messageIndex];
    }
}
```

